'''Professor Onglewip''' is a [[gnome]] sent by [[King Narnode Shareen]] to study [[human]] magic at the [[Wizards' Tower]]. He is found on the {{FloorNumber|uk=0}}, generally in the library, although he can sometimes be found outside the tower. If players are doing hard orders in the [[Gnome Restaurant]] [[minigame]] they may have to deliver food to Onglewip.

